import React from 'react';

const GrampsSection = () => {
  return (
    <section id="gramps" className="py-12 bg-gray-100">
      <div className="container mx-auto px-4 text-center">
        <div className="flex justify-between items-center mb-8">
          {/* Logo */}
          <div className="mr-4">
            <img src="your-logo.png" alt="Your Logo" className="h-12" />
          </div>
          {/* Acronym spelled out */}
          <div className="text-5xl font-bold">
            <span className="text-yellow-500">Geriatric </span>
            <span className="text-gray-500">Resources</span>
            <span className="text-yellow-500">Advising</span>
            <span className="text-gray-500">Moving</span>
            <span className="text-yellow-500">Placement</span>
            <span className="text-gray-500">Services of Tennessee</span>
           
          </div>
        </div>
        <p className="text-lg text-gray-800 mb-8">
          Geriatric Resources, Advising, Moving, & Placement Services of Tennessee (GRAMPS) provides comprehensive services for seniors and their families.
        </p>
        {/* Add more content as needed */}
      </div>
    </section>
  );
}

export default GrampsSection;
